name: Generate Crossword rebuild script
steps:
  - name: step_03
    steps:
      - name: Remove generated code
        rmdir: step_03
      - name: Create project
        flutter: create --empty generate_crossword --platforms=macos,linux,windows,ios,android
      - name: Strip DEVELOPMENT_TEAM
        strip-lines-containing: DEVELOPMENT_TEAM =
        path: generate_crossword/ios/Runner.xcodeproj/project.pbxproj
      - name: Configure analysis_options.yaml
        path: generate_crossword/analysis_options.yaml
        replace-contents: |
          include: ../../analysis_options.yaml

          linter:
            rules:
              prefer_const_constructors: false

      - name: Remove README
        rm: generate_crossword/README.md
      - name: Add .vscode directory
        mkdir: generate_crossword/.vscode
      - name: Add .vscode/launch.json
        path: generate_crossword/.vscode/launch.json
        replace-contents: |
          {
              // Use IntelliSense to learn about possible attributes.
              // Hover to view descriptions of existing attributes.
              // For more information, visit: https://go.microsoft.com/fwlink/?linkid=830387
              "version": "0.2.0",
              "configurations": [
                  {
                      "name": "generate_crossword",
                      "request": "launch",
                      "type": "dart"
                  }
              ]
          }
      - name: Add dependencies
        path: generate_crossword
        flutter: pub add built_collection built_value characters flutter_riverpod intl riverpod riverpod_annotation two_dimensional_scrollables worker_manager dev:build_runner dev:built_value_generator dev:custom_lint dev:riverpod_generator dev:riverpod_lint
      - name: Replace lib/main.dart
        path: generate_crossword/lib/main.dart
        replace-contents: |
          // Copyright 2024 The Flutter Authors. All rights reserved.
          // Use of this source code is governed by a BSD-style license that can be
          // found in the LICENSE file.
          
          import 'package:flutter/material.dart';
          import 'package:flutter_riverpod/flutter_riverpod.dart';
          
          void main() {
            runApp(
              ProviderScope(
                child: MaterialApp(
                  title: 'Crossword Builder',
                  debugShowCheckedModeBanner: false,
                  theme: ThemeData(
                    useMaterial3: true,
                    colorSchemeSeed: Colors.blueGrey,
                    brightness: Brightness.light,
                  ),
                  home: Scaffold(
                    body: Center(
                      child: Text(
                        'Hello, World!',
                        style: TextStyle(fontSize: 24),
                      ),
                    ),
                  ),
                ),
              ),
            );
          }

      - name: Build iOS simulator bundle
        platforms: [ macos ]
        path: generate_crossword
        flutter: build ios --simulator
      - name: Build macOS app
        platforms: [ macos ]
        path: generate_crossword
        flutter: build macos
      - name: Build Linux app
        platforms: [ linux ]
        path: generate_crossword
        flutter: build linux
      - name: Build Windows app
        platforms: [ windows ]
        path: generate_crossword
        flutter: build windows
      - name: Copy step_03
        copydir:
          from: generate_crossword
          to: step_03
      - name: Flutter clean
        path: step_03
        flutter: clean
  - name: step_04
    steps:
      - name: Remove generated code
        rmdir: step_04
      - name: patch pubspec.yaml
        path: generate_crossword/pubspec.yaml
        patch: |
          --- a/generate_crossword/step_04/pubspec.yaml
          +++ b/generate_crossword/step_04/pubspec.yaml
          @@ -31,3 +31,5 @@ dev_dependencies:

           flutter:
             uses-material-design: true
          +  assets:
          +    - assets/words.txt
      - name: mkdir lib/widgets
        mkdir: generate_crossword/lib/widgets
      - name: Add lib/widgets/widgets.dart
        path: generate_crossword/lib/widgets/widgets.dart
        replace-contents: |
          // Copyright 2024 The Flutter Authors. All rights reserved.
          // Use of this source code is governed by a BSD-style license that can be
          // found in the LICENSE file.
          
          export 'crossword_generator_app.dart';
      - name: Add lib/widgets/crossword_generator_app.dart
        path: generate_crossword/lib/widgets/crossword_generator_app.dart
        replace-contents: |
          // Copyright 2024 The Flutter Authors. All rights reserved.
          // Use of this source code is governed by a BSD-style license that can be
          // found in the LICENSE file.
          
          import 'package:flutter/material.dart';
          import 'package:flutter_riverpod/flutter_riverpod.dart';
          
          import '../providers.dart';
          
          class CrosswordGeneratorApp extends StatelessWidget {
            const CrosswordGeneratorApp({super.key});
          
            @override
            Widget build(BuildContext context) {
              return _EagerInitialization(
                child: Scaffold(
                  appBar: AppBar(
                    titleTextStyle: TextStyle(
                      color: Theme.of(context).colorScheme.primary,
                      fontSize: 16,
                      fontWeight: FontWeight.bold,
                    ),
                    title: Text('Crossword Generator'),
                  ),
                  body: SafeArea(
                    child: Consumer(
                      builder: (context, ref, _) {
                        final wordListAsync = ref.watch(wordListProvider);
                        return wordListAsync.when(
                          data: (wordList) => ListView.builder(
                            itemCount: wordList.length,
                            itemBuilder: (context, index) {
                              return ListTile(
                                title: Text(wordList.elementAt(index)),
                              );
                            },
                          ),
                          error: (error, stackTrace) => Center(
                            child: Text('$error'),
                          ),
                          loading: () => Center(
                            child: CircularProgressIndicator(),
                          ),
                        );
                      },
                    ),
                  ),
                ),
              );
            }
          }
          
          class _EagerInitialization extends ConsumerWidget {
            const _EagerInitialization({required this.child});
            final Widget child;
          
            @override
            Widget build(BuildContext context, WidgetRef ref) {
              ref.watch(wordListProvider);
              return child;
            }
          }
      - name: Add lib/providers.dart
        path: generate_crossword/lib/providers.dart
        replace-contents: |
          // Copyright 2024 The Flutter Authors. All rights reserved.
          // Use of this source code is governed by a BSD-style license that can be
          // found in the LICENSE file.
          
          import 'package:built_collection/built_collection.dart';
          import 'package:flutter/services.dart';
          import 'package:riverpod_annotation/riverpod_annotation.dart';
          
          part 'providers.g.dart';
          
          /// A provider for the wordlist to use when generating the crossword.
          @riverpod
          Future<BuiltSet<String>> wordList(WordListRef ref) async {
            // This codebase requires that all words consist of lowercase characters
            // in the range 'a'-'z'. Words containing uppercase letters will be
            // lowercased, and words containing runes outside this range will
            // be removed.
          
            final re = RegExp('^[a-z]+\$');
            final str = await rootBundle.loadString('assets/words.txt');
            return str.split('\n').toBuiltSet().rebuild((b) => b
              ..map((str) => str.toLowerCase().trim())
              ..removeWhere((str) => str.length < 3)
              ..removeWhere((str) => re.stringMatch(str) == null));
          }
      - name: generate lib/providers.g.dart
        path: generate_crossword
        flutter: pub run build_runner build --delete-conflicting-outputs
      - name: mkdir assets
        mkdir: generate_crossword/assets
